import pandas as pd

# Read the sales data
df = pd.read_csv('sales_data.csv')

# Ensure date column is in datetime format
if 'date' in df.columns:
    df['date'] = pd.to_datetime(df['date'])
elif 'Date' in df.columns:
    df['date'] = pd.to_datetime(df['Date'])

# Extract year from date
df['year'] = df['date'].dt.year

# Group by product and year to get total sales per product per year
if 'product' in df.columns:
    product_col = 'product'
elif 'Product' in df.columns:
    product_col = 'Product'
else:
    product_col = df.columns[0]  # Fallback to first column

if 'sales' in df.columns:
    sales_col = 'sales'
elif 'Sales' in df.columns:
    sales_col = 'Sales'
else:
    sales_col = df.columns[-1]  # Fallback to last column

yearly_sales = df.groupby([product_col, 'year'])[sales_col].sum().reset_index()

# Calculate year-over-year growth for each product
result = {}

for product in yearly_sales[product_col].unique():
    product_data = yearly_sales[yearly_sales[product_col] == product].sort_values('year')

    if len(product_data) >= 2:
        # Get the most recent year and previous year
        recent_year = product_data.iloc[-1]
        previous_year = product_data.iloc[-2]

        # Calculate growth percentage
        if previous_year[sales_col] != 0:
            growth = ((recent_year[sales_col] - previous_year[sales_col]) / previous_year[sales_col]) * 100
            result[product] = round(growth, 2)
        else:
            result[product] = 0.0
    else:
        result[product] = 0.0
